INSERT INTO `ndboard_comment` VALUES (1,999,'관리자','1234','관리자','<p>국회에 제출된 법률안 기타의 의안은 회기중에 의결되지 못한 이유로 폐기되지 아니한다. 다만, 국회의원의 임기가 만료된 때에는 그러하지 아니하다. 비상계엄하의 군사재판은 군인·군무원의 범죄나 군사에 관한 간첩죄의 경우와 초병·초소·유독음식물공급·포로에 관한 죄중 법률이 정한 경우에 한하여 단심으로 할 수 있다. 다만, 사형을 선고한 경우에는 그러하지 아니하다.<br></p>','2023-10-20 16:04:05'),(2,999,'홍길동','1234','홍길동','<p><span class=\"tagnamecolor\" style=\"color: brown; font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\"><span class=\"tagcolor\" style=\"color: mediumblue;\">&lt;</span>ul<span class=\"attributecolor\" style=\"color: red;\">&nbsp;class<span class=\"attributevaluecolor\" style=\"color: mediumblue;\">=\"list-group\"</span></span><span class=\"tagcolor\" style=\"color: mediumblue;\">&gt;</span></span><br style=\"color: rgb(0, 0, 0); font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\"><span style=\"color: rgb(0, 0, 0); font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\">&nbsp;&nbsp;</span><span class=\"tagnamecolor\" style=\"color: brown; font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\"><span class=\"tagcolor\" style=\"color: mediumblue;\">&lt;</span>li<span class=\"attributecolor\" style=\"color: red;\">&nbsp;class<span class=\"attributevaluecolor\" style=\"color: mediumblue;\">=\"list-group-item\"</span></span><span class=\"tagcolor\" style=\"color: mediumblue;\">&gt;</span></span><span style=\"color: rgb(0, 0, 0); font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\">First item</span><span class=\"tagnamecolor\" style=\"color: brown; font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\"><span class=\"tagcolor\" style=\"color: mediumblue;\">&lt;</span>/li<span class=\"tagcolor\" style=\"color: mediumblue;\">&gt;</span></span><br style=\"color: rgb(0, 0, 0); font-family: Consolas, Menlo, &quot;courier new&quot;, monospace; font-size: 15px;\"><span styl